import React, { PureComponent }  from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import UploadPage from './components/UploadPage';
import ListPage from './components/ListPage';
import Home from './Home';
import Nav from './Nav';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import {
  Provider as Web3Provider,
  Updater as Web3Updater,
} from "./contexts/Web3";
import axios from 'axios';

interface videoState {
  imageList: any[];
};
class videoLinks extends PureComponent<{}, videoState> {
  constructor(props: any) {
      super(props);
      this.state = {
          imageList: [],
      };
  }
  componentDidMount = () => {
      axios.get('http://localhost:9890/')
          .then(response => {
              this.setState({ imageList: response.data.images });
          })
          .catch(err => alert(err));
  }
  render() {
  return (
    <div>
    {this.state.imageList.map((file) => (
      <Route exact path={'/video/' + file.filename} component={UploadPage} />
  ))}
  </div>
  );
    }
}

export default videoLinks;

var videoarray:any[] = [{filename:''},];  

axios.get('http://localhost:9890/')
    .then(response => {
      videoarray.push({filename: response.data.filename});
    })
    .catch(err => alert(err));

ReactDOM.render(
  <React.StrictMode>
    <Router>
    <Web3Provider>
      <Nav />
      <Switch>
        {videoarray.map(video => (
      <Route exact path={'/bruh/' + video.filename} component={UploadPage} />
      ))}
        <Route path="/connectwallet" component={Home} />
        <Route path="/upload" component={UploadPage} />
        <Route path="/" component={ListPage} />
        </Switch>
      <Web3Updater />
    </Web3Provider>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
